


  --alter table   [CT dwh 02 Data].[c4po].[tInputAPI] ADD jsonResponse  nvarchar(max)


  declare @json as nvarchar(max) 
  set @json = '{

            "destinationCountry": "##COUNTRY##",
            "postalCode": "##POSTALCODE##",
            "packages": [
                {
                    "size": {
                        "length": ##LENGTH##,
                        "width": ##WIDTH##,
                        "height": ##HEIGHT##
                    },
                    "volume": ##VOLUME##,
                    "weight": ##WEIGHT##,
                    "value": 1000
                }
            ],
            "requiredServiceIds": [
                73
            ],
            "allowedWarehouseIds": [
                1
            ]
        }'


  update  [CT dwh 02 Data].[c4po].[tInputAPI]
  SET jsonRequest = @json

  select * ,     
        JSON_VALUE(value, '$.totalCost') AS totalCost,
        JSON_QUERY(value, '$.serviceCosts') AS serviceCosts
    FROM OPENJSON(rjsonResponse, '$.orderCosts')
  from [CT dwh 02 Data].[c4po].[tInputAPI] 


  SELECT CustomerOrder,destinationCountry,
		jsonRequest =REPLACE(REPLACE(REPLACE(
				REPLACE(REPLACE(REPLACE(REPLACE(jsonRequest,'##COUNTRY##',destinationcountry),'##POSTALCODE##',postalCode),'##LENGTH##',[length]),'##WIDTH##',width)
				,'##HEIGHT##',height),'##VOLUME##',volume),'##WEIGHT##',[weight])
  FROM 
  [CT dwh 02 Data].[c4po].[tInputAPI]



    update api set weight = 9800 from [CT dwh 02 Data].[c4po].[tInputAPI] api where [weight] = 9800000


	SELECT 
    LEFT(CustomerOrder,8),CustomerOrder,destinationCountry,
    JSON_VALUE(jsonResponse, '$.orderCosts[0].shipmentCosts[0].totalCost') AS totalCost
FROM 
  [CT dwh 02 Data].[c4po].[tInputAPI]
  where JSON_VALUE(jsonResponse, '$.orderCosts[0].shipmentCosts[0].totalCost') is not null


  WITH ParsedJSON AS (
    SELECT 
        CustomerOrder, 
        JSON_VALUE(jsonResponse, '$.orderCosts[0].shipmentCosts[0].totalCost') AS totalCost,
        JSON_QUERY(jsonResponse, '$.orderCosts[0].serviceCosts') AS serviceCosts
    FROM 
  [CT dwh 02 Data].[c4po].[tInputAPI]
)
    SELECT 
        CustomerOrder,
        CAST(JSON_VALUE(cost, '$.cost') AS INT) AS cost
    FROM 
        ParsedJSON
    CROSS APPLY 
        OPENJSON(serviceCosts) 
        WITH (cost NVARCHAR(50) '$.cost')

,
ServiceCosts AS (
    SELECT 
        CustomerOrder,
        CAST(JSON_VALUE(value, '$.cost') AS INT) AS cost
    FROM 
        ParsedJSON
    CROSS APPLY 
        OPENJSON(serviceCosts) 
        WITH (cost NVARCHAR(50) '$.cost')
)

SELECT 
    p.CustomerOrder,
    p.totalCost,
    ISNULL(SUM(s.cost), 0) AS totalServiceCost
FROM 
    ParsedJSON p
LEFT JOIN 
    ServiceCosts s ON p.CustomerOrder = s.CustomerOrder
GROUP BY 
    p.id, p.totalCost;





